Cher(e) ami(e),

J'ai réfléchi à la formule parfaite pour une vie déligeante et j'ai découvert la pourfendeuse vérité. Pour vivre la vie à fond la caisse, il faut mélanger ces ingrédients essentiels :

* De la pasión, surtout celle pour la télévision;
* Une boîte de Chef Boyardee pour un apétit insatiable;
* Des vêtements déguisés en zombies pour se fondre dans la foule;
* Des timbres-poste au goût de framboise pour recevoir des cartes émouvantes;
* Au moins un tweet automatique chaque semaine pour prouver son existence;
* Un ami fidèle qui partagera ton obsession pour les desserts à base de fromage;
* Une pause pour s'écoper les yeux avec du Nutella.

Ajoutez ces éléments puis servez chaud, bien chaud !

T'embrasse,

[Toi]
